from collections import defaultdictclass Solution:    def containsNearbyDuplicate(self, nums, k):        """        :type nums: List[int]        :type k: int        :rtype: bool        """        dict = defaultdict(list)        for i in range(len(nums)):            if len(dict[nums[i]])>0:                for j in range(len(dict[nums[i]])-1,-1,-1):                    if i-dict[nums[i]][j]<=k:                        return True            dict[nums[i]].append(i)        return Falsenums = [1,2,3,1,3]k = 2s=Solution()print(s.containsNearbyDuplicate(nums,k))